#! /bin/sh

# whatbasic.sh:  Basic tests for the "what" command.

# Import common functions & definitions.
. ../common/test-common

files="f"

remove $files

trigger="@(#)"

remove f
echo  > f

# "what" ignores stdin.
docommand w1 "${what} < f" 0 IGNORE IGNORE
docommand w2 "${what} < f" 0 "" ""

# Check basic operation when no match.
docommand w3 "${what}   f" 0 "f:\n" ""


echo "${trigger}foo" > f
echo "invisible" >> f

docommand w4 "${what} f" 0 "f:\n\tfoo\n" ""

# Now we add a space
echo "${trigger}foo" > f
echo "invisible" >> f

# The space should be skipped.
docommand w5 "${what} f" 0 "f:\n\tfoo\n" ""

# Also need to be able to cope with multiple matches in the same file.
echo "${trigger}bar" >> f
echo "invisible2" >> f

docommand w6 "${what} f" 0 "f:\n\tfoo\n\tbar\n" ""


# The -s option should restrict us to just one match. 
docommand w7 "${what} -s f" 0 "f:\n\tfoo\n" ""

# We should be able to diagnose the inability to open the input file.
# We ignore STDERR because we don't want to ensure that the text of the 
# error message is always the same.
docommand w8 "${what} -s nonexistent" 1 "" IGNORE

remove f
echo "${trigger}"foo"${trigger}" > f
echo "invisible" >> f

docommand w9 "${what} f" 0 "f:\n\tfoo${trigger}\n" ""

remove f
echo "@hello@" > f
docommand w10 "${what} f" 0 "f:\n" ""

# Various forms of incomplete trigger
../../testutils/ekko -n "@" > f
docommand w11 "${what} f" 0 "f:\n" ""

../../testutils/ekko -n "@(" > f
docommand w12 "${what} f" 0 "f:\n" ""

../../testutils/ekko -n "@(#" > f
docommand w13 "${what} f" 0 "f:\n" ""

# A match but with nothing to show for it...
../../testutils/ekko -n "@(#)" > f
docommand w14 "${what} f" 0 "f:\n\t\n" ""


# Provoke a usage error - make sure we get a failure return
# Note the different return value.
docommand w15 "${what} -Z" 2 IGNORE IGNORE


# What-string terminated by a backslash...
remove f
../../testutils/ekko -ne "${trigger}hello\\" > f
docommand w16 "${what} f" 0 "f:\n\thello\n" ""

# What-string terminated by a null character
remove f
../../testutils/ekko -ne "${trigger}hello\0\nworld" > f
docommand w17 "${what} f" 0 "f:\n\thello\n" ""

# What-string terminated by a null character
remove f
../../testutils/ekko -ne "${trigger}hello\0world\n" > f
docommand w18 "${what} f" 0 "f:\n\thello\n" ""

# Various bits of trailing stuff
# Hmm.  What is supposed to ignore various kinds of trailing garbage
# but test that prpoerly we have to insert more than 16K of trailing garbage.
# Let's hope we don;t fall over some kind of limit...
remove f
../../testutils/ekko -ne "${trigger}hello>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>